public class NestedLoopTask2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for(int x=0; x<4;x++) {
			System.out.println("Itereation "+(x+1));
			for(int y=15; y>4;y--) {
				System.out.print(y+" ");
				
			}
			System.out.println();
		}
	}

}
